defs.script:
    //
function reRenderHMI(RS485DataStr){
  RS485DataStr.RS485Data.forEach(element => {
    if(element.MemoryType === 0){ // FILL COIL STATE TO SVG
      let idElementON =
      'ON-' + `${element.SlaveId}` + '-' + `${element.Address}`;
      let idElementOFF =
      'OFF-' + `${element.SlaveId}` + '-' + `${element.Address}`;
      let strHiddenOrVisibleOFF =
        element.CoilValue ? 'hidden' : 'visible';
      let strHiddenOrVisibleON = element.CoilValue ? 'visible' : 'hidden';
      Array.prototype.forEach.call(document.getElementsByClassName(`${idElementON}`), function(item) {item.style.visibility = `${strHiddenOrVisibleON}`;});
      Array.prototype.forEach.call(document.getElementsByClassName(`${idElementOFF}`), function(item) {item.style.visibility = `${strHiddenOrVisibleOFF}`;});
    } else if (element.MemoryType == 1) { //FILL VALUE TO TEXT
      let idTXT =
          'TXT-' + `${element.SlaveId}` + '-' + `${element.Address}`;
          let valueTXT =element.Value.toFixed(1);
      Array.prototype.forEach.call(document.getElementsByClassName(`${idTXT}`), function(item) {item.textContent = `${valueTXT}`;});
    }
    //
  });
  // example class name: MULTI ON-2-47 && ON-2-48 
  // SET STATE FOR COIL THAT HAS MULTI CONDITIONS
  Array.prototype.forEach.call( document.getElementsByClassName("MULTI"), function(itemClass) {
    let fullClassesName = itemClass.className.animVal;
    let valuesWithConditions = fullClassesName.replaceAll('MULTI ','');
    let arrayValues = [];
    // SPLIT VALUE NAME FROM STRING
    valuesWithConditions.split(' ').forEach(item => {
      if(item.includes('ON')){
        let splitClassON = item.split('-');
        console.log(splitClassON.toString());
        console.log(RS485DataStr.RS485Data.find(rs485=> rs485.SlaveId==splitClassON[1] && rs485.Address==splitClassON[2]));
        let conditionValue = (RS485DataStr.RS485Data.find(rs485=> rs485.SlaveId==splitClassON[1] && rs485.Address==splitClassON[2])).CoilValue;
        console.log(item +conditionValue);
        arrayValues.push(conditionValue);
      }
      else if (item.includes('OFF')){
        let splitClassON = item.split('-');
        let conditionValue = !(RS485DataStr.RS485Data.find(rs485=> rs485.SlaveId==splitClassON[1] && rs485.Address==splitClassON[2]).CoilValue);
        console.log(item +conditionValue);
        arrayValues.push(conditionValue);
      }
      else if (item.includes('TXT')){
        let splitClassON = item.split('-');
        let conditionValue = (RS485DataStr.RS485Data.find(rs485=> rs485.SlaveId==splitClassON[1] && rs485.Address==splitClassON[2]).value);
        console.log(item +conditionValue);
        arrayValues.push(conditionValue);
      } else {
        arrayValues.push(item);
      }

    });
    // FULL CONDITION 
    let conditionsStr = arrayValues.toString().split(',').join(' ');
    console.log('Condition String: ', conditionsStr);
    if(eval(conditionsStr)){
      console.log('Final result: ', true);
      //Answer
     }else {
      console.log('Final result: ', false);
     };
     let strHiddenOrVisibleON = eval(conditionsStr) ? 'visible' : 'hidden';
     Array.prototype.forEach.call(document.getElementsByClassName(`${fullClassesName}`), function(item) {item.style.visibility = `${strHiddenOrVisibleON}`;});

  });
  return RS485DataStr.WifiInfo;
}
